pragma solidity ^0.4.11;
import "zeppelin-solidity/contracts/ownership/Ownable.sol";
import "./Contract.sol";


contract Employee is Ownable {

    struct Work {
        address work;
        address company;
        bool isFinish;
    }

    struct Skill {
        uint skillCode;
        uint rating;
    }

    Work[] public workHistory;
    uint public rating;
    uint[] public specializationCodes;
    Skill[] public skills;
    mapping (uint => uint[]) private skillToSpecialization;

    string private firstName;
    string private lastName;
    string private email;
    address private employeeAddress;

    modifier onlyOwnerOrEmployee() {
        require(msg.sender == owner || msg.sender == employeeAddress);
        _;
    }

    function Employee(string _firstName, string _lastName, string _email, address _employee) public {
        firstName = _firstName;
        lastName = _lastName;
        email = _email;
        employeeAddress = _employee;
    }

    function () public payable {
        owner.transfer(msg.value);
    }

    function fillSpecializations(uint[] _specializationCodes, uint[] _skills,
                                    uint[] _ratings, uint[] _skillToSpecialization) public onlyOwner {
        uint _rating;

        for (uint i = 0; i < _skills.length; i++) {
            skills.push(Skill(_skills[i], _ratings[i]));
            _rating += _ratings[i];
        }

        rating = _rating;
        specializationCodes = _specializationCodes;

        for (i = 0; i < _skillToSpecialization.length; i++) {
            skillToSpecialization[skills[i].skillCode].push(_skillToSpecialization[i]);
        }
    }

    function getSenderContractCount() public view returns (uint result) {
        for (uint i = 0; i < workHistory.length; i++) {
            if (msg.sender == address(workHistory[i].company))
                result++;
        }
        return result;
    }

    function getFirstContractFrom(uint from) public view returns (int, address company) {

        for (uint i = from; i < workHistory.length; i++) {
            if (msg.sender == address(workHistory[i].company))
                return (int(i), company);
        }
        return (-1, company);
    }

    function addWork(address work, address company) public onlyOwner {
        for (uint i = 0; i < workHistory.length; i++) {
            if (work == workHistory[i].work) {
                revert();
            }
        }
        workHistory.push(Work(work, company, false));
    }

    function addSpecialization(uint specializationCode, uint skillCode, uint skillRating) public onlyOwner {
        skillToSpecialization[skillCode].push(specializationCode);
        specializationCodes.push(specializationCode);
        skills.push(Skill(skillCode, skillRating));
    }

    function finishWork(address work) public onlyOwner {
        for (uint i = 0; i < workHistory.length; i++) {
            if (work == workHistory[i].work) {
                workHistory[i].isFinish = true;
                return;
            }
        }
    }

    function changeRaiting(uint newRaiting) public onlyOwner {
        rating = newRaiting;
    }

    function dispute(Contract work) public onlyOwnerOrEmployee {
        for (uint i = 0; i < workHistory.length; i++) {
            if (address(work) == workHistory[i].work) {
                work.disputeStatusOn();
                workHistory[i].isFinish = true;
                return;
            }
        }
    }
}
